import React, { useEffect, useState } from "react";
import Button from '@mui/material/Button';
const App=()=>{
  useEffect(()=>{
    alert('above button is clicked ');
  },[num])
const[num,setNum]=useState(0);
const[num2,setNum2]=useState(0);

return(
   <>
    <h1>Helloo EveryOne</h1>
    <Button onClick={()=>{
      setNum(num+1);
    }}>Click Me {num}</Button><br></br>
    <Button onClick={()=>{
      setNum2(num2+1);
    }}>Click Me {num2}</Button>
   </>

);
  
}
export default App;
